import React from 'react'
import Conditional from './conditional'



class Formz extends React.Component {
    constructor() {
        super()
        this.state = {
            isLogged: true
        }
    }
    componentDidMount() {
        setTimeout(() => {
            this.setState({
                isLoading: false
            })
        },1500)
    }


    render() {
        return (
            <div>
                <Conditional isLoading={this.state.isLoading} />
            </div>
        )
    }
}

export default Formz
